import React, { useState } from "react";
import { Container, Row, Col, Nav } from "react-bootstrap";
import Profile from "./Profile";
import PetProfile from "./PetProfile";

export default function User() {
  const [activeTab, setActiveTab] = useState("profile");

  const handleSelect = (selectedKey) => {
    setActiveTab(selectedKey);
  };

  const renderComponent = () => {
    switch (activeTab) {
      case "profile":
        return <Profile />;
      case "petprofile":
        return <PetProfile />;
      case "login":
        return <div>Login & Security</div>;
      case "support":
        return <div>Support</div>;
      default:
        return null;
    }
  };

  return (
    <Container>
      <Row>
        <Col sm={4}>
          <Nav
            className="flex-column mt-3"
            variant="pills"
            activeKey={activeTab}
            onSelect={handleSelect}
          >
            <Nav.Item>
              <Nav.Link eventKey="profile">Profile</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link eventKey="petprofile">Pet Profile</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link eventKey="login">Login & Security</Nav.Link>
            </Nav.Item>
            <Nav.Item>
              <Nav.Link eventKey="support">Support</Nav.Link>
            </Nav.Item>
          </Nav>
        </Col>
        <Col sm={8}>{renderComponent()}</Col>
      </Row>
    </Container>
  );
}
